import React, { useState, useEffect } from 'react'
import { Link } from 'react-router-dom';


interface IMovie {
    id: string;
    img: string;
    title: string;
  }

const Home = () => {
    useEffect(() => {
        getPopulateMovies();
    }, []); 

    const [ popularMovies, setPopularMovies ] = useState<IMovie>();
    const getPopulateMovies = async () => {
        const response = await fetch('https://api.themoviedb.org/3/movie/popular?api_key=5bcd76c471e358e143b8721211e000d4')
        const allPopularMovies: any = await response.json;

        console.log(allPopularMovies);
        setPopularMovies(allPopularMovies);
    }

    return (
        <div>
            <div>search bar</div>
            <div>
                {popularMovies.map((popularMovie) => (
                    <Link to={`/item-page/${popularMovie.id}`}>
                        <img ></img>
                        {popularMovie.title}
                    </Link>
                ))}
            </div>
        </div>
    )
}

export default Home
